import React from "react";
import { Link } from "react-router-dom";
import GitHub from "../../images/gitty.png"

function Footer() {
    return (
        <footer>
            <Link
            to="https://github.com/jeffgcameron">
            <img src={GitHub}/>

            </Link>
        </footer>
)
}

export default Footer;
